import React, { Component } from 'react'

export default class Message extends Component {
    state = {
        messageArr : [
            { id: 1, title: '消息一' },
            { id: 2, title: '消息二' },
            { id: 3, title: '消息三' }
        ]
    }
    render() {
        const { messageArr } = this.state
        return (
            <div>
                <ul>
                {
                    messageArr.map(message => {
                        return (
                            <li key={message.id}>
                                <a href="/message1">{message.title}</a>&nbsp;&nbsp;
                            </li>
                        )
                    })
                }
                </ul>
            </div>
        )
    }
}
